import * as React from 'react';
import Link from '@mui/material/Link';
import Typography from '@mui/material/Typography';
import Title from './Title';

function preventDefault(event) {
  event.preventDefault();
}

export default function Deposits() {
  return (
    <React.Fragment>
      <Title>Current Badges</Title>
      <Typography component="p" variant="h4" color='mediumseagreen'>
        $3,024.00
      </Typography>
      <div>
      <Button size='big' inverted>

        <Link to="/BussinessLogin" style={{color: 'white'}}> Get Started as a Business </Link>

      </Button>
        <Link to href="http://Google.com" onClick={preventDefault} style={{color : 'mediumseagreen'}}>
          Generate New Badge
        </Link>
      </div>
    </React.Fragment>
  );
}
